import React from "react";

const BigCardContainer = () => {
  const styles = {
    backgroundRepeat: "norepeat",
    backgroundSize: "cover",
    backgroundPosition: "center",
    textAlign: "left",
    paddingLeft: "3rem",
    width: "100vw",
    height: "80vh"
  };

  return <div></div>;
};

export default BigCardContainer;
